import {MDBContainer} from "mdbreact";
import React from "react";
import {Bar} from "react-chartjs-2";

export type ChartProps = {
    BarChartData?:any;
    barChartOptions?:any;
    donutchartdata?: any;
    data?:any;
    graphData:any;

}

const Charts=(props:ChartProps)=> {
  const output: any = [];

  Array.isArray(props?.graphData) && props?.graphData?.forEach(items=> {
    if(items?.type ==="barchart") {
      output.push(
          <MDBContainer>
          <Bar data={items?.data} options={items?.barChartOptions} height={items?.BarChartData?.height} />
        </MDBContainer>
        )
    }
  })
  return output;
}

export default Charts;
